import { DefaultButton } from "./defaultButton";

export function IMGButton(props){
    const {width=35, height=35} = props

    return (<DefaultButton add={{backgroundImage:props.path}} width={width} height={height} click={props.click} 
                           top={props.top} left={props.left}/>)
}
